to throw ya\nI\'m disgusted, wonder what could\'ve made ya tuck your tail below ya\nAnd no I\'m not your soldier I\'m not taking any orders\nI\'m a five star general, infantry controller\nNeed a lesson? Let me show ya\nHave you checking your composure\nWhile I make you step to it like 1, 2, 3, 4\n\n[Page Hamilton (Chester Bennington):]\nAnd if I do what you demand\n(You say)\nYou\'ll let me understand\n(You say)\nYou\'re gonna hold me to your word\nAnd if I sell myself away\n(You say)\nI\'ll have no debt to pay\n(You say)\nI\'m gonna get what I deserve\nWhoa\n\nAnd if I do what you demand\nYou\'ll let me understand\n\nYour word\nObeyed\nMy debt\nRepaid\nOur trust\nBetrayed\nAll for nothing\nAll for nothing\nAll for nothing\n\nOh oh oh oh\n\n[Mike:] Maybe we\'re too far\n[Brad:] I don\'t think we\'re too far\n[Mike:] Really?\n[Brad:] That\'s a good verse. Put the heavy shit there\n[Mike:] The heavy shit? Right here?','Thanks to Aleck M for adding these lyrics.\nThanks to John Andrei Sanchez, Deepto for correcting these lyrics.Writer(s): Mike Shinoda, Chester Charles Bennington, Joseph Hahn, Brad Delson, Robert G. Bourdon, David Farrell','https://www.azlyrics.com/lyrics/linkinpark/allfornothing.html',11038,64,'2023-10-02 04:59:48','2023-10-02 04:59:48'),(826,'Guilty All The Same',NULL,NULL,'https://www.azlyrics.com/lyrics/linkinpark/guiltyallthesame.html',11038,64,'2023-10-02 04:59:48','2023-10-02 04:59:48'),(827,'The Summoning(Instrumental)',NULL,NULL,'',11038,64,'2023-10-02 04:59:48','2023-10-02 04:59:48'),(828,'War',NULL,NULL,'https://www.azlyrics.com/lyrics/linkinpark/war.html',11038,64,'2023-10-02 04:59:48','2023-10-02 04:59:48'),(829,'Wastelands',NULL,NULL,'https://www.azlyrics.com/lyrics/linkinpark/wastelands.html',11038,64,'2023-10-02 04:59:48','2023-10-02 04:59:48'),(830,'Until It\'s Gone',NULL,NULL,'https://www.azlyrics.com/lyrics/linkinpark/untilitsgone.html',11038,64,'2023-10-02 04:59:48','2023-10-02 04:59:48'),(831,'Rebellion',NULL,NULL,'https://www.azlyr